/*Table structure for table `route` */

DROP TABLE IF EXISTS `route`;

CREATE TABLE `route` (
  `routeid` int(8) NOT NULL AUTO_INCREMENT COMMENT '路由ID',
  `RoutingPrefix` varchar(64) DEFAULT NULL COMMENT '号码前缀(基于号码前缀路由，NULL为忽略匹配规则为最长匹配)',
  `DomainPrefix` int(8) DEFAULT NULL COMMENT '域名前缀(基于域名前缀路由，NULL为忽略匹配规则为最长匹配)',
  `proxyid` int(8) NOT NULL COMMENT '服务器ID',
  PRIMARY KEY (`routeid`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1 COMMENT='路由信息管理';

