/*Table structure for table `service` */

DROP TABLE IF EXISTS `service`;

CREATE TABLE `service` (
  `serviceid` varchar(64) NOT NULL COMMENT '业务ID',
  `pid` varchar(64) NOT NULL COMMENT '产品ID 索引',
  `Enabled` int(8) DEFAULT NULL COMMENT '业务激活(0：业务未激活，1：业务激活)',
  `TriggerType` int(8) DEFAULT NULL COMMENT '业务触发类型(0：无条件触发，1：用户属性触发，2：号码前缀触发，3：消息内容触发)',
  `TriggerLocation` int(8) NOT NULL COMMENT '业务触发位置(1：主叫用户属性触发，2：被叫用户属性触发，3：主被叫用户属性都可以触发)',
  `DefPriority` int(8) DEFAULT NULL COMMENT '默认触发优先级(1到99999的数字，数字越大，触发优先级越高；默认触发优先级一般供非用户属性类业务触发使用，在用户属性触发类业务没有设置主叫、被叫触发优先级的时候，也可作为默认触发优先级)',
  `OrgPriority` int(8) DEFAULT NULL COMMENT '主叫属性触发优先级(1到99999的数字，数字越大，触发优先级越高；)',
  `DstPriority` int(8) DEFAULT NULL COMMENT '被叫属性触发优先级(1到99999的数字，数字越大，触发优先级越高；)',
  `servReg` int(8) DEFAULT NULL COMMENT '是否需要第三方注册(0:不需要,1:需要)',
  `appservID` int(8) NOT NULL COMMENT '业务路由信息(业务最终指向的业务服务器id)',
  PRIMARY KEY (`serviceid`),
  KEY `pid` (`pid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='业务信息触发管理';

