/*Table structure for table `source` */

DROP TABLE IF EXISTS `source`;

CREATE TABLE `source` (
  `sourceid` int(8) NOT NULL COMMENT '呼叫源ID 主键',
  `SourceType` int(8) NOT NULL COMMENT '呼叫源类型(0：未知呼叫源，1：用户终端类呼叫源，2：能力服务类呼叫源，3：其他代理类呼叫源)',
  `SourceAddr` varchar(1024) NOT NULL COMMENT '呼叫源地址(接入LoadBalancer的地址)',
  `SourcePort` int(8) NOT NULL COMMENT '呼叫源端口(接入LoadBalancer的端口)',
  `sourceTrans` int(11) NOT NULL DEFAULT '0' COMMENT '传输类型（1：TLS，2：TCP，3：UDP，4：SCTP，5：DCCP，6：DTLS）',
  PRIMARY KEY (`sourceid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='呼叫源信息管理';

