/*Table structure for table `stlist` */

DROP TABLE IF EXISTS `stlist`;

CREATE TABLE `stlist` (
  `SubscribeID` varchar(64) NOT NULL COMMENT '签约索引',
  `serviceid` varchar(64) NOT NULL COMMENT '业务ID',
  `RulesId` int(8) NOT NULL COMMENT '触发条件ID,触发条件序号1~10',
  `MatchPoint` int(8) NOT NULL COMMENT '匹配点(1：方法名,2：RequestURI,3：Herder)',
  `HeaderName` varchar(64) DEFAULT NULL COMMENT '消息头名称(默认NULL当MatchPoint=3，设置消息头名字)',
  `MatchRules` int(8) NOT NULL COMMENT '匹配规则(1：完整匹配,2：包含前缀,3：包含后缀,4：包含内容)',
  `MatchInfo` varchar(64) NOT NULL COMMENT '匹配内容(要匹配的字符串内容)',
  `RulesRelation` int(8) DEFAULT '1' COMMENT '匹配条件连接符(1：AND（默认）,2：OR)',
  PRIMARY KEY (`SubscribeID`),
  KEY `serviceid` (`serviceid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='消息内容匹配触发业务签约管理';

/*Data for the table `stlist` */

/*Table structure for table `stprefix` */

DROP TABLE IF EXISTS `stprefix`;

CREATE TABLE `stprefix` (
  `SubscribeID` varchar(64) NOT NULL COMMENT '签约索引',
  `serviceid` varchar(64) NOT NULL COMMENT '业务ID 索引',
  `Method` varchar(64) NOT NULL COMMENT '方法名(“INVITE”“SUBSCRIBE”“PUBLISH”“MESSAGE”“REFER”)',
  `MatchRules` int(8) NOT NULL COMMENT '匹配规则(0：无前缀,1：完整匹配,2：包含前缀,3：包含后缀)',
  `Prefix` varchar(64) DEFAULT NULL COMMENT '号码前缀(号码前缀在SIP请求中是RequestURI中指向的URI地址的用户部分)',
  PRIMARY KEY (`SubscribeID`),
  KEY `serviceid` (`serviceid`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1 COMMENT='号码前缀触发业务签约管理';

